            <div className="container">
                <h2>Areas We Serve</h2>
                <div id="st-louis">
                    <h3>St. Louis</h3>
                    <p>Providing quality cleaning services in St. Louis and surrounding areas.</p>
                </div>
                <div id="chicago">
                    <h3>Chicago</h3>
                    <p>We cover the Chicago area with our exceptional cleaning services.</p>
                </div>
                {/* Add more areas as needed */}
            </div>
        </section>
    );
}

